import { MDBContainer, MDBCard, MDBCardText, MDBBtn, MDBIcon } from 'mdb-react-ui-kit';
import React from 'react';

export default function Story() {
  return (
    <MDBContainer className='p-0 m-0 shadow-0 square' style={{ minHeight:'6rem', minWidth:'6rem', maxHeight:'6rem', maxHeight:'6rem' }}>
      <MDBCard  className='p-0 m-0 text-center shadow-0' style={{ minHeight:'6rem', minWidth:'6rem', maxHeight:'6rem', maxHeight:'6rem' }}>
        <MDBBtn className='rounded-circle'><MDBIcon fas icon="user-astronaut" /></MDBBtn>
        <MDBCardText className='text-nowrap'>
          Jon Smith
        </MDBCardText>
      </MDBCard>
    </MDBContainer>
  );
}
